	////È¡µÚÈ«Æ´×Ö·û
	public function getFullSpell($input, $delimiter = ' '){
		return implode($delimiter, $this->xsplit($input));
	}
	//È¡µÚÒ»¸öÆ´Òô×Ö·û
	public function getFirstSpell($input, $delimiter = ' '){
		$spell = $this->xsplit($input);
		foreach($spell as $k=>$v){
			$spell[$k] = substr($v, 0, 1);
		}
		return implode($delimiter, $spell);
	}
	
	//»ñÈ¡×Ö·ûÖÐÎÄÆ´Òô£¬Êý×Ö×ÖÄ¸Ö±½ÓÊä³ö£¬·ûºÅ²»Êä³ö
	private function getChineseSpell($zh){
		if(!$zh) return;
		preg_match('/'.$zh.'=([A-Z ]*)/', $this->TableText, $matches);
		//print_r($matches);
		$spells = explode(' ',$matches[1]);
		return $spells[0];
	}
	//½«×Ö·û´®×ª»»ÎªÊý×é£¬¼æÈÝÖÐÓ¢ÎÄ
	private function xsplit($input){
		if(!$input) return;
		$string = trim($input);
		$len = strlen($string);
		$strings = null;
		for($i = 0; $i < $len; $i++) {
			$ascii = ord($string[$i]);
			if($ascii < 128) {
				if(($ascii >= 48 && $ascii <= 57) || ($ascii >= 97 && $ascii <= 122)) {
					$spell = strtoupper($string[$i]); // 0-9 a-z
				}elseif($ascii >= 65 && $ascii <= 90) {
					$spell = $string[$i]; // A-Z
				}else{
					$spell = '';
				}
				$strings[0][] = $string[$i];
				$strings[1][] = $spell;
			}else{
				//$zh = $string[$i].$string[++$i].$string[++$i]; //UTF-8±àÂëÖÐÎÄ×Ö·û³¤¶ÈÎª3
				$zh = $string[$i].$string[++$i]; //ANSI±àÂëÖÐÎÄ×Ö·û³¤¶ÈÎª2
				$strings[0][] = $zh;
				$strings[1][] = $this->getChineseSpell($zh);
			}
		}
		//print_r($strings);
		return $strings[1];
	}
